import React from 'react';

const Slot = (props) =>{
    // let x='smile';
    // let y='smile';
    // let z='smil';
    let x=props.x;
    let y=props.y;
    let z=props.z; 

    if((x===y) && (y===z)){
        return(
         <>
            <div className="slot_inner">
              <h1>
               {x} {y} {z}
              </h1>
              <h1>This is Matching.</h1>
            </div>
         </>
        );
    }

    else{
        return(
            <>
               <div className="slot_inner">
                 <h1>
                  {x} {y} {z}
                 </h1>
                 <h1>This is not Matching .</h1>
               </div>
            </>
           );
    }
}

const App = () =>{
   return(
       <>
         <h1 className="heading_style"> Welcome to <span style={{ fontWeight: "bold"}}>Slot machine game</span> :slot</h1>
         <div className="slotmachine">
         <Slot x='smile' y='smile' z='smile'/>
         <Slot/>
         <Slot/>
         </div>
       </>
   )
}

export default App;
